import React from 'react';

function Expenses() {
	const date = new Date();
	const ExpenseData = [
		{
			date: new Date(),
			item: 'Toilet Papper',
			cost: '99',
		},
	];
	return (
		<div>
			<h1>{date.toLocaleString()}</h1>
		</div>
	);
}

export default Expenses;
